Кто поддержал признание «ЛДНР» Россией?

— Сирия; 
— Венесуэла; 
— Никарагуа; 
— Куба; 
— Частично признанная Республика Абхазия; 
— Частично признанная Южная Осетия; 
— Непризнанная Нагорно-Карабахская Республика; 
— Непризнанная Приднестровская Молдавская Республика

❗️Санкции ЕС против РФ могут включать:

▪️Ограниченный список лиц и организаций;

▪️Запрет на добычу полезных ископаемых;

▪️Запрет на торговлю с "ДНР" и "ЛНР".

❗️Зеленский в свою очередь заявил, что санкции против РФ должны подразумевать полную остановку "Северный Поток-2"
